import React from "react";
import SingleInputContainer from './SingleInputContainer';
import Warning from "./warning";


function Doctor(props){
    const {values,errors,handler,handleSubmit} = Warning(add);
    const addDoctorInputValue=[
        {
          'name':'fName',
          'type':'text',
          'error': errors.fName,
          'label':'First Name',
          'required':true,
          'validationType':"name"
        },{
          'name':'lName',
          'type':'text',
          'error':errors.lName,
          'label':'Last Name',
          'required':true,
          'validationType':"name"
        },{
          'name':'cellPhone1',
          'type':'tel',
          'error':errors.cellPhone1,
          'label':'Cell Phone 1',
          'required':true,
          'validationType':"phone"
        },{
          'name':'cellPhone2',
          'type':'tel',
          'error':errors.cellPhone1,
          'label':'Cell Phone 2(optional)',
          'required':false,
          'validationType':"phone"
        },{
          'name':'city',
          'type':'text',
          'error':errors.city,
          'label':'City',
          'required':true,
          'validationType':"name"
        },{
          'name':'subcity',
          'type':'text',
          'error':errors.subcity,
          'label':'Sub City',
          'required':true,
          'validationType':"name"
        },{
          'name':'woreda',
          'type':'number',
          'error':errors.woreda,
          'label':'Woreda',
          'required':true,
          'validationType':"phone"
        },{
          'name':'birthPlace',
          'type':'text',
          'error':errors.birthPlace,
          'label':'Birth Place',
          'required':true,
          'validationType':"name"
        },{
          'name':'dob',
          'type':'Date',
          'error':errors.dob,
          'label':'Date Of Birth',
          'required':true,
          'validationType':"date"
        },{
          'name':'email',
          'type':'email',
          'error':errors.email,
          'label':'Email',
          'required':true,
          'validationType':"email"
        },{
          'name':'universityName',
          'type':'text',
          'error':errors.universityName,
          'label':'University Name',
          'required':true,
          'validationType':"name"
        },{
          'name':'yearOfGraduaion',
          'type':'date',
          'error':errors.yearOfGraduaion,
          'label':'Year Of Graduaion',
          'required':true,
          'validationType':"phone"
        },{
          'name':'CGPA',
          'type':'number',
          'error':errors.CGPA,
          'label':'CGPA',
          'required':true,
          'validationType':"phone"
        },{
          'name':'language',
          'type':'text',
          'error':errors.language,
          'label':'Language',
          'required':true,
          'validationType':"name"
        },
      ];
      function add() {
        alert("added");
      }
      const addDoctorInput=addDoctorInputValue.map((value)=>{
        return(<SingleInputContainer name={value.name} type={value.type} handler={handler}
        label={value.label} error={value.error} required={value.required}/>);
      })
    return(
        <form  onSubmit={handleSubmit}>
          <div className='formInput'>
          <div className='personal_Information'> 
            <h3 className="title">Personal Information</h3>
            <div className='fullName'>
              {addDoctorInput[0]}{addDoctorInput[1]}
            </div>
            <div className='phoneNumber'>
              {addDoctorInput[2]}{addDoctorInput[3]}
            </div>
            <div className='address'>
              {addDoctorInput[4]}{addDoctorInput[5]}{addDoctorInput[6]}
            </div>
            <div className='birthInfo'>
              {addDoctorInput[7]}{addDoctorInput[8]}
            </div>
              {addDoctorInput[9]}
          </div>
          <hr className='middleHr'/>
          <div className='acadamy_information'>
            <h3 className="title">Acadamy Information</h3>
              {addDoctorInput[10]}{addDoctorInput[11]}{addDoctorInput[12]}{addDoctorInput[13]}
          </div>
          </div>
          <button type="submit">Submit</button>
        </form> 
);
}
export default Doctor;
